import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {location: null, username: null, code: null};
  }

  render () {
    return (
      <div id="home">
        <div id="greeting">
          <h3>Welcome to</h3>
          <h1>Chicken Tinder</h1>
          <img src="assets/img/heart.png" id="heart1"/>
          <img src="assets/img/heart.png" id="heart2"/>
          <img src="assets/img/chicken.png" id="chicken"/>
        </div>

        <div id="locations">
            <div>
                <p><img src="assets/img/egg.png" class="egg"/>Southside</p>
                <p><img src="assets/img/egg.png" class="egg"/>Northside</p> 
            </div>
            <div>
                <p class="selected"><img src="assets/img/egg.png" class="selected egg"/>Downtown</p>
                <p><img src="assets/img/egg.png" class="egg"/>Elmwood</p>
            </div>
        </div>

        <button>
            <a href="swipe.html">Create Group</a>
        </button>

        <p> ---- or ----</p>

        <p>Enter Username:</p>
        <input type="text"/>
        <p>Enter Group Code:</p>
        <input type="text"/>
        <div>
            <button>
                <a href="swipe.html">Join Group</a>
            </button>
        </div>
      </div>
    );
  }

}

export default App;
